import React from 'react';
import { Table } from 'reactstrap';
import fetch from 'isomorphic-unfetch';
import { render } from "react-dom";
import ReactTable from "react-table";


class ProjectTable extends React.Component{
  constructor() {
    super();
    this.state = {
      data: {}
    };
  }
  

  render () {
    return (
      <div>
        <ReactTable
          data={data}
          columns={[
            {
              Header: "Name",
              columns: [
                {
                  Header: "First Name",
                  accessor: "firstName"
                },
                {
                  Header: "Last Name",
                  id: "lastName",
                  accessor: d => d.lastName
                }
              ]
            },
            {
              Header: "Info",
              columns: [
                {
                  Header: "Age",
                  accessor: "age"
                },
                {
                  Header: "Status",
                  accessor: "status"
                }
              ]
            },
            {
              Header: 'Stats',
              columns: [
                {
                  Header: "Visits",
                  accessor: "visits"
                }
              ]
            }
          ]}
          defaultPageSize={10}
          className="-striped -highlight"
        />
      </div>
    
  );
  }
  
}

export default ProjectTable;
